import React from "react";
import { Button, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, IconButton, TableCell, TableRow, Tooltip } from "@mui/material"
import axios from "axios";
import CancelIcon from '@mui/icons-material/Cancel';
import AddchartIcon from '@mui/icons-material/Addchart';

export const Linha = ({ row, labelId, user }) => {

    const [open, setOpen] = React.useState({
        open: false,
        tipo: "Validar as GRTs",
        frase: "Ser치 liberado 13 GRTs ao despachante Bernado Brandine Brandao"
    });
    const [open0, setOpen0] = React.useState(false);
    const [open1, setOpen1] = React.useState(false);
    const [response, setResponse] = React.useState();

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };
    const handleClose1 = () => {
        setOpen1(false);
    };

    const cancelarGrt = () => {
        console.log("Cancelado")
    }

    const handleConfirm = () => {
        console.log("clicado")
        axios.post('http://192.168.15.49:3005/GerarGRT', {
            row,
        })
            .then(response => {
                console.log(response)
                setResponse(response.data)
                setOpen(false)
                setOpen1(true)
                row.situacao = "EM PROCESSO"
            })
            .catch(error => {
                console.log(error)
            })
    }

    return (
        <>
            <Dialog
                open={open}
                onClose={handleClose}
                aria-labelledby="Validar"
                aria-describedby="Validar-description"
            >
                <DialogTitle id="Validar">
                    {row.quantidade > 1 ? "Validar as GRTs" : "Validar a GRT"}
                </DialogTitle>
                <DialogContent>
                    <DialogContentText id="Validar-description">
                        {row.quantidade > 1 ? `Ser치 liberado ${row.quantidade} GRTs ao despachante ${row.nome}` : `Ser치 liberado 1 GRT ao despachante ${row.nome}`}
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button color='success' onClick={() => handleConfirm()} >Confirmar</Button>
                    <Button color='error' onClick={handleClose} >Cancelar</Button>
                </DialogActions>
            </Dialog>
            <Dialog
                open={open1}
                onClose={handleClose1}
                aria-labelledby="Confirmar"
                aria-describedby="Confirmar-description"
            >
                <DialogTitle id="Confirmar">
                    {row.quantidade > 1 ? "GRT inserida com sucesso" : "GRTs inseridas com sucesso"}
                </DialogTitle>
                <DialogContent>
                    <DialogContentText id="Confirmar-description">
                        {row.quantidade > 1 ? `Foi liberado ${row.quantidade} GRTs ao despachante ${row.nome}` : `Ser치 liberado 1 GRT ao despachante ${row.nome} sendo ela a ${response && response.GRTletra}${response && response.GRTnumero}`}
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button color='success' onClick={handleClose1} >Concluir</Button>
                </DialogActions>
            </Dialog>
            <TableRow
                key={row._id}
                hover
            >
                <TableCell sx={{ '& > *': { borderBottom: 'unset' } }}>
                </TableCell>
                <TableCell
                    component="th"
                    id={labelId}
                    scope="row"
                    padding="none"
                >
                    {row.nome}
                </TableCell>
                <TableCell align="right">{row.data}</TableCell>
                <TableCell align="right">{row.hora}</TableCell>
                <TableCell align="right">{row.quantidade}</TableCell>
                <TableCell align="right">{row.situacao}</TableCell>
                <TableCell>
                    {row.situacao === "SOLICITADO" && user.usuariotipo === 'master' ?
                    <>
                    <Tooltip title='Enviar GRT'>
                        <IconButton onClick={handleClickOpen} color='primary' >
                            <AddchartIcon />
                        </IconButton>
                    </Tooltip>
                    <Tooltip title='Cancelar GRT'>
                        <IconButton onClick={handleClickOpen} color='error' >
                            <CancelIcon />
                        </IconButton>
                    </Tooltip>
                    </>
                        : null
                    }
                    {row.situacao === "SOLICITADO" && user.usuariotipo === "despachante" ?
                        <Tooltip title="Solicitar o cancelamento da solicita칞칚o">
                            <IconButton
                                onClick={cancelarGrt}
                                color='error handleClickOpen'
                            >
                                <CancelIcon />
                            </IconButton>
                        </Tooltip>
                        : null
                    }
                </TableCell>
                <TableCell sx={{ '& > *': { borderBottom: 'unset' } }}>
                </TableCell>
            </TableRow>
        </>
    )
}
